Presa scrie că acesta este un cimitir a vehiculelor electrice din Paris cu bateriile epuizate. Bateriile nu sunt înlocuite, deoarece sunt foarte scumpe și nimeni nu ia bateriile vechi pentru reciclare. Și toată această porcărie se descompune și otrăvește natura. Lumea verde, da...
